const AcceptModal = (accept, { close }) => {
    return (
        <div className="acceptModal">
            <button onClick={() => accept}>DELETE</button>
            <button onClick={() => close(false)}>ANULUJ</button>
        </div>
    );
};

export default AcceptModal;
